import React from "react";
import "./Form.css";

const Form = (props) => {
  return (
    <div className="">
    <h1 className="ma2"> Enter city and country </h1>
    <div className="">
      <form onSubmit={props.loadweather}>
        <div>{props.error ? error() : ""}</div>
        <div className="ma4">
          <div className="items-center">
            <input
              type="text"
              className="pv3 shadow"
              placeholder="City"
              name="city"
              autoComplete="off"
            />
          </div>
          <div className="items-center">
            <input
              type="text"
              className="items-center pv3 shadow"
              placeholder="Country"
              name="country"
              autoComplete="off"
            />
          </div>
          <div className="">
            <button className="b ph3 input-reset ba b--black bg-transparent grow pointer f6 dib">Get Weather</button>
          </div>
        </div>
      </form>
    </div>
    </div>
  );
};

const error = props => {
  return (
    <div className="alert alert-danger mx-5" role="alert">
      Please Enter City and Country...!
    </div>
  );
};

export default Form;
